  false,\n\t\"url\": null,\n\t\"notes\": \"This collection of narrative reports for
  Carolina Sandhills National Wildlife Refuge summarizes refuge activities from January
  through December 1955. The report begins with a summary of weather, water conditions,
  and fires during the period. Wildlife including migratory birds, upland game birds,
  big game animals, fish, and furbearers is also covered. A refuge development and
  maintenance section covers physical development. The farming operations section
  discusses plantings and cultivated crops. A public relations section outlines recreational
  use and refuge visitation. Items of interest are provided at the end of the report.\",\n\t\"license_title\":
